INSERT INTO `concert` VALUES (1,'AC/DC','2021-08-05 22:00:13.000000','Τους περιμέναμε τριάντα (και βάλε) χρόνια και μας έκαναν την χάρη να έρθουν, έστω και στα… γεράματα. Ποια γεράματα δηλαδή, οι AC/DC «κεραυνοβόλησαν» το ΟΑΚΑ σαν να μην γέρασαν ποτέ. Το rock \'n\' roll τρένο με τον κιθαρίστα Angus Young δεμένο πισθάγκωνα συγκρούεται (κυριολεκτικά) με τη σκηνή του ΟΑΚΑ και οι πρώτες νότες από το Rock N\' Roll Train κάνουν τους χιλιάδες οπαδούς τους να παραληρούν, ακόμα και όσους «καθωσπρέπει» επέλεξαν να κάτσουν στις κερκίδες. Highlight της βραδιάς το τελετουργικό στριπτίζ του Angus υπό τους ήχους του “The Jack”, η φουσκωτή γιγαντιαία γκόμενα Rosie στο ομώνυμο τραγούδι, φυσικά το ανεπανάληπτο «Highway to Hell» και η ομοβροντία κανονιών στο For Those About To Rock','https://www.rockrooster.gr/wp-content/uploads/2020/11/ACDC-3.jpg',1,25),(2,'AC/DC','2021-08-10 22:00:13.000000','Τους περιμέναμε τριάντα (και βάλε) χρόνια και μας έκαναν την χάρη να έρθουν, έστω και στα… γεράματα. Ποια γεράματα δηλαδή, οι AC/DC «κεραυνοβόλησαν» το ΟΑΚΑ σαν να μην γέρασαν ποτέ. Το rock \'n\' roll τρένο με τον κιθαρίστα Angus Young δεμένο πισθάγκωνα συγκρούεται (κυριολεκτικά) με τη σκηνή του ΟΑΚΑ και οι πρώτες νότες από το Rock N\' Roll Train κάνουν τους χιλιάδες οπαδούς τους να παραληρούν, ακόμα και όσους «καθωσπρέπει» επέλεξαν να κάτσουν στις κερκίδες. Highlight της βραδιάς το τελετουργικό στριπτίζ του Angus υπό τους ήχους του “The Jack”, η φουσκωτή γιγαντιαία γκόμενα Rosie στο ομώνυμο τραγούδι, φυσικά το ανεπανάληπτο «Highway to Hell» και η ομοβροντία κανονιών στο For Those About To Rock','https://www.rockrooster.gr/wp-content/uploads/2020/11/ACDC-3.jpg',2,25),(4,'Black Sabbath / Rival Sons  ','2021-05-12 19:58:33.000000','Τους περιμέναμε πάρα πολύ αλλά άξιζε τον κόπο και πλέον ο ερχομός τους είναι γεγονός!\r\nΜην το χάσεις! Κλείσε τώρα εισιτήρια για να τους δεις από κοντά!','https://www.nme.com/wp-content/uploads/2020/09/blacksabbath-696x442.jpg',110,10),(5,'Suzanne Vega / Kitchens of D